- input: TEXT,F3XA,,"Item 1 - This report includes the memo Schedule A's for the joint
    fundraising activity from American Women Vote 2002.  Item 2 - The memo Schedule
    A for the Democratic National Committee Victory Fund Unitemized was inadvertently
    included in the original report.  Item 3 - No employee of the committee spent
    more than 25% of their time in any given month working on any Federal Election
    Activity or activities in connection with a Federal Election. Therefore salary
    payments were made directly from a non-federal account.  Item 4 - Due to staff
    turnover the committee has inadvertently transferred an excess of 33661.24 in
    non-federal money to the federal account for allocable activity.  We have transferred
    this excess back to the non-federal account.  Item 5- The items identified on
    the Schedule H4 disclosing payments for salary and wages were to individuals who
    were not employees of the committee at the time of payments.  Item 6 - Part of
    the allocable activity included in the original report are payments for previous
    year expenses and have been assigned to the prior year administrative percentages.  Item
    7 - the descriptions for Schedule H4 have been clarified.  Misc - The ending cash
    balance has changed due to the omission of a disbursement of 105.13 on the original
    report.",
